import axios from 'axios';
import React, { createContext, useEffect, useState } from 'react'
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { useNavigate } from 'react-router-dom';
import ListingPage from '../Pages/ListingPage';

const MyContext = createContext()

const SearchCarBox = () => {
  

    const navigate = useNavigate(); 
    const { REACT_APP_SERVER_URL } = process.env;
    const [fromDate, setFromDate] = useState(new Date());
    const [toDate, setToDate] = useState(new Date());
    const [fromTime, setFromTime] = useState();
    const [toTime, settoTime] = useState();
    const [city, setcity] = useState();
    const [location, setlocation] = useState();
    const [first, setfirst] = useState(false)
    useEffect(() => {
      fetchCity()
    }, [city])
    const fetchCity=async()=>{
        await axios({
            url:`${REACT_APP_SERVER_URL}/Hexrental/api/web-city/list`,
            method:"GET",
            headers: {
                'Content-Type': 'application/json'
            },
        }).then((response)=>{
            console.log(response.data,'data');
            setcity(response.data.cityDet)            
        }) .catch((err) => {
            if(err.request){ console.log(err.request) } if(err.response){ 
                console.log(err.response)
          
          }})

    }
    const fetchLocation=async()=>{
      await axios({
        url:`${REACT_APP_SERVER_URL}/Hexrental/api/web-city/list`,
        method:"GET",
        headers: {
            'Content-Type': 'application/json'
        },
    }).then((response)=>{
        console.log(response.data,'data');
        set(response.data.cityDet)            
    }) .catch((err) => {
        if(err.request){ console.log(err.request) } if(err.response){ 
            console.log(err.response)
      
      }})
    }
  const handleFromDateChange = (date) => {
    console.log(date,'from date');
    setFromDate(date);
    // setToDate(null); // reset to date when from date changes
  };
  const handleToDateChange = (date) => {
    setToDate(date);
    console.log(date,'to date');
  };
  const handleFromTime=(event)=>{
    setFromTime((event.target.value))
    console.log(event.target.value,'from time');
  }
  const handleToTime=(event)=>{
    settoTime((event.target.value))
    console.log(event.target.value,'to time');
  }

  let Day1 = String(fromDate.getDate()).padStart(2, '0');
  let Month1 = String(fromDate.getMonth() + 1).padStart(2, '0');
  let Year1 = new Date(fromDate).getFullYear();
  let dayone = `${Year1}-${Month1}-${Day1} ${fromTime}`;
  console.log(dayone);
  
  let Day2 = String(toDate.getDate()).padStart(2, '0');
  let Month2 = String(toDate.getMonth() + 1).padStart(2, '0');
  let Year2 = new Date(toDate).getFullYear();
  let daytwo = `${Year2}-${Month2}-${Day2} ${toTime}`;
  console.log(daytwo);

const searchCar=async()=>{
    await axios({
        // url:`${REACT_APP_SERVER_URL}/api/item/search-web?from_date=${dayone}&${fromTime+':00'}&to_date=${daytwo}&${toTime+':00'}&city_id=1&city_loc_id=2&cur_type=1&vehicle_type=0&brand_type=0`,
        url:`${REACT_APP_SERVER_URL}/Hexrental/api/item/search-web?from_date=${dayone}&to_date=${daytwo}&city_id=1&city_loc_id=2&cur_type=1&vehicle_type=0&brand_type=0`,
        method:"GET"
    }).then((response)=>{
        console.log(response.data,'success');
        // setlist(response.data.Models)
        navigate('/carlisting')
    }).catch((error)=>{
        console.log(error);
    })
}
  return (
    
        <div className="col-lg-4 car-banner-img">
            <div className="banner-registration">
                <div className="banner-registration-registration">
                    <h6 className="banner-register-name">Search your ride</h6>
                </div>
                    <div className="form-group">
                        <label for="exampleFormControlSelect1" className="banner-form-label">SELECT CITY</label>
                        <select className="form-control" id="exampleFormControlSelect1">
                            {city.map((e)=>{
                                return(

                                    <option value={e.city_id}>{e.city_name}</option>
                                )
                            })}
                        </select>
                      </div>
                      <div className="form-group">
                        <label for="exampleFormControlSelect1" className="banner-form-label">SELECT LOCATION</label>
                        <select className="form-control" id="exampleFormControlSelect1" >
                          <option>1</option>
                        </select>
                      </div>
                      
    
        <div className="row">
            <div className="form-group col-md-6 col-6 date-col">
                <label for="exampleFormControlSelect1" className="banner-form-label">RETURN DATE</label>
                
                 <DatePicker
                        id="from-date"
                        selected={fromDate}
                        onChange={handleFromDateChange}
                        minDate={new Date()}
                        startDate={fromDate}
                        selectsStart
                        className="form-control"
                        dateFormat="yyyy/MM/dd"
                />

            </div>
           
            <div className="form-group col-md-6 col-6 time-col">
                <label for="exampleFormControlSelect1" className="banner-form-label">RETURN TIME</label>
                <select name="ddlpickTime" id="ddlpickTime" className="time-box form-control" value={fromTime} onChange={handleFromTime} >
                    <option value="00:00:00">00:00</option>
                    <option value="00:30:00">00:30</option>
                    <option value="01:00:00">01:00</option>
                    <option value="01:30:00">01:30</option>
                    <option value="02:00:00">02:00</option>
                    <option value="02:30:00">02:30</option>
                    <option value="03:00:00">03:00</option>
                    <option value="03:30:00">03:30</option>
                    <option value="04:00:00">04:00</option>
                    <option value="04:30:00">04:30</option>
                    <option value="05:00:00">05:00</option>
                    <option value="05:30:00">05:30</option>
                    <option value="06:00:00">06:00</option>
                    <option value="06:30:00">06:30</option>
                    <option value="07:00:00">07:00</option>
                    <option value="07:30:00">07:30</option>
                    <option value="08:00:00">08:00</option>
                    <option value="08:30:00">08:30</option>
                    <option value="09:00:00">09:00</option>
                    <option value="09:30:00">09:30</option>
                    <option value="10:00:00">10:00</option>
                    <option value="10:30:00">10:30</option>
                    <option value="11:00:00">11:00</option>
                    <option value="11:30:00">11:30</option>
                    <option value="12:00:00">12:00</option>
                    <option value="12:30:00">12:30</option>
                    <option value="13:00:00">13:00</option>
                    <option value="13:30:00">13:30</option>
                    <option value="14:00:00">14:00</option>
                    <option value="14:30:00">14:30</option>
                    <option value="15:00:00">15:00</option>
                    <option value="15:30:00">15:30</option>
                    <option value="16:00:00">16:00</option>
                    <option value="16:30:00">16:30</option>
                    <option value="17:00:00">17:00</option>
                    <option value="17:30:00">17:30</option>
                    <option value="18:00:00">18:00</option>
                    <option value="18:30:00">18:30</option>
                    <option value="19:00:00">19:00</option>
                    <option value="19:30:00">19:30</option>
                    <option value="20:00:00">20:00</option>
                    <option value="20:30:00">20:30</option>
                    <option value="21:00:00">21:00</option>
                    <option value="21:30:00">21:30</option>
                    <option value="22:00:00">22:00</option>
                    <option value="22:30:00">22:30</option>
                    <option value="23:00:00">23:00</option>
                    <option value="23:30:00">23:30</option>
                  </select>
            
            </div>
          </div>
       
         
         <div className="row">
            <div className="form-group col-md-6 col-6 date-col">
                <label for="exampleFormControlSelect1" className="banner-form-label">RETURN DATE</label>
                {/* <input name="txtdate" type="date" id="txtdate" className="form-control"/> */}
                <DatePicker
        id="to-date"
        selected={toDate}
        onChange={handleToDateChange}
        minDate={fromDate}
        startDate={fromDate}
        className="form-control"
        selectsEnd
        dateFormat="yyyy/MM/dd"
        disabled={!fromDate} // disable until from date is selected
      />
                
            </div>
            <div className="form-group col-md-6 col-6 time-col">
                <label for="exampleFormControlSelect1" className="banner-form-label">RETURN TIME</label>
                <select name="ddlpickTime" id="ddlpickTime" className="time-box form-control" value={toTime} onChange={handleToTime} >
                    <option value="00:00:00">00:00</option>
                    <option value="00:30:00">00:30</option>
                    <option value="01:00:00">01:00</option>
                    <option value="01:30:00">01:30</option>
                    <option value="02:00:00">02:00</option>
                    <option value="02:30:00">02:30</option>
                    <option value="03:00:00">03:00</option>
                    <option value="03:30:00">03:30</option>
                    <option value="04:00:00">04:00</option>
                    <option value="04:30:00">04:30</option>
                    <option value="05:00:00">05:00</option>
                    <option value="05:30:00">05:30</option>
                    <option value="06:00:00">06:00</option>
                    <option value="06:30:00">06:30</option>
                    <option value="07:00:00">07:00</option>
                    <option value="07:30:00">07:30</option>
                    <option value="08:00:00">08:00</option>
                    <option value="08:30:00">08:30</option>
                    <option value="09:00:00">09:00</option>
                    <option value="09:30:00">09:30</option>
                    <option value="10:00:00">10:00</option>
                    <option value="10:30:00">10:30</option>
                    <option value="11:00:00">11:00</option>
                    <option value="11:30:00">11:30</option>
                    <option value="12:00:00">12:00</option>
                    <option value="12:30:00">12:30</option>
                    <option value="13:00:00">13:00</option>
                    <option value="13:30:00">13:30</option>
                    <option value="14:00:00">14:00</option>
                    <option value="14:30:00">14:30</option>
                    <option value="15:00:00">15:00</option>
                    <option value="15:30:00">15:30</option>
                    <option value="16:00:00">16:00</option>
                    <option value="16:30:00">16:30</option>
                    <option value="17:00:00">17:00</option>
                    <option value="17:30:00">17:30</option>
                    <option value="18:00:00">18:00</option>
                    <option value="18:30:00">18:30</option>
                    <option value="19:00:00">19:00</option>
                    <option value="19:30:00">19:30</option>
                    <option value="20:00:00">20:00</option>
                    <option value="20:30:00">20:30</option>
                    <option value="21:00:00">21:00</option>
                    <option value="21:30:00">21:30</option>
                    <option value="22:00:00">22:00</option>
                    <option value="22:30:00">22:30</option>
                    <option value="23:00:00">23:00</option>
                    <option value="23:30:00">23:30</option>
                  </select>
            </div>
          </div>
         <div className="form-register">         
         <button className="btn btn-primary form-register-btn" type="submit" onClick={searchCar}>SEARCH</button>
        </div> 

            </div>
            <MyContext.Provider value={{
              value1:[fromDate, setFromDate],
              value2:[toDate,setToDate],
              value3:[fromTime,setFromTime],
              value4:[toTime,settoTime]}}>
              {first?<ListingPage/>:""}

            </MyContext.Provider>
        </div>
        
  )
}

export default SearchCarBox
export {MyContext}
